import React, {FC} from 'react';
import cl from "./MainPage.module.css"

const MainPage: FC = () => {
  return (
    <div className={cl.mainpageContainer}> 
     <div className={cl.mainpage}>
     </div>
     <section className="basket"></section>

    </div>

  );
};

export default MainPage;
